  \"black-tern-population-survey-and-other-marsh-bird-monitoring-activities-in-vermont-2002\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report takes a look at marsh bird
  population trends within the marshes of Vermont, and investigates the effect of
  water level and marsh vegetation changes on marsh bird numbers. Relationships between
  various marsh bird nesting patterns are discussed as well as correlations between
  black tern nesting locations and water level. Recommendations are made for management
  activities which could benefit the black tern nesting population.\",\n\t\"license_title\":
